import { Button, Form, Input } from 'antd';
import { IdcardTwoTone } from '@ant-design/icons';


function App() {
  const onFinish = (values) => {
    console.log('Received values of form: ', values);
  };
  return (
    <div className="App">
      <Form
        name="normal_login"
        className="login-form"
        initialValues={{
          remember: true,
        }}
        onFinish={onFinish}
      >
        <div className="login"></div>
    </Form>
    </div>
  );
}

export default App;
